import React, { useState } from "react";

const RegisterDiaspora = () => {
  const [formData, setFormData] = useState({
    fullName: "",
    email: "",
    country: "",
    profession: "",
    expertise: "",
    availability: "part-time",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Diaspora Registration Data:", formData);
    alert("Thank you for registering!");
    setFormData({
      fullName: "",
      email: "",
      country: "",
      profession: "",
      expertise: "",
      availability: "part-time",
    });
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 via-green-50 to-yellow-50 py-16 px-4">
      <div className="max-w-3xl mx-auto bg-white p-8 shadow-xl rounded-xl">
        <h1 className="text-3xl font-bold text-blue-800 mb-6 text-center">
          Diaspora Registration
        </h1>
        <form onSubmit={handleSubmit} className="space-y-5">
          <div>
            <label className="block font-semibold text-gray-700 mb-1">Full Name</label>
            <input
              type="text"
              name="fullName"
              required
              value={formData.fullName}
              onChange={handleChange}
              className="w-full border border-gray-300 px-4 py-2 rounded-lg focus:ring focus:ring-blue-200 outline-none"
            />
          </div>
          <div>
            <label className="block font-semibold text-gray-700 mb-1">Email</label>
            <input
              type="email"
              name="email"
              required
              value={formData.email}
              onChange={handleChange}
              className="w-full border border-gray-300 px-4 py-2 rounded-lg focus:ring focus:ring-blue-200 outline-none"
            />
          </div>
          <div>
            <label className="block font-semibold text-gray-700 mb-1">Country of Residence</label>
            <input
              type="text"
              name="country"
              required
              value={formData.country}
              onChange={handleChange}
              className="w-full border border-gray-300 px-4 py-2 rounded-lg focus:ring focus:ring-blue-200 outline-none"
            />
          </div>
          <div>
            <label className="block font-semibold text-gray-700 mb-1">Profession</label>
            <input
              type="text"
              name="profession"
              required
              value={formData.profession}
              onChange={handleChange}
              className="w-full border border-gray-300 px-4 py-2 rounded-lg focus:ring focus:ring-blue-200 outline-none"
            />
          </div>
          <div>
            <label className="block font-semibold text-gray-700 mb-1">Areas of Expertise</label>
            <textarea
              name="expertise"
              required
              value={formData.expertise}
              onChange={handleChange}
              className="w-full border border-gray-300 px-4 py-2 rounded-lg focus:ring focus:ring-blue-200 outline-none"
              rows={4}
            />
          </div>
          <div>
            <label className="block font-semibold text-gray-700 mb-1">Availability</label>
            <select
              name="availability"
              value={formData.availability}
              onChange={handleChange}
              className="w-full border border-gray-300 px-4 py-2 rounded-lg focus:ring focus:ring-blue-200 outline-none"
            >
              <option value="full-time">Full-time</option>
              <option value="part-time">Part-time</option>
              <option value="ad-hoc">Ad-hoc</option>
            </select>
          </div>
          <button
            type="submit"
            className="w-full bg-green-600 hover:bg-green-700 text-white py-3 rounded-lg font-semibold transition-all duration-300"
          >
            Register
          </button>
        </form>
      </div>
    </div>
  );
};

export default RegisterDiaspora;
